import Cards from "../../components/cards/cards";
import cardImg from "../../img/1.jpg";
import "./corevalues.css";

export default function coreValues(){
    return(
        <div className="corevalue">
            {/* <div className="coreTitle">Our Core Values</div> */}
            <div className="coreCards">
                <div className="coreLeft">
                    <Cards  cardTitle="Creativity" cardImg={cardImg} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                    <Cards  cardTitle="Creativity" cardImg={cardImg} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                </div>
                <div className="coreRight">
                    <Cards  cardTitle="Creativity" cardImg={cardImg} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                    <Cards  cardTitle="Creativity" cardImg={cardImg} cardDetail="dfb hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj b hfhjgb vhfdvb fh vf  falhb vj fab fhvblfavhabfsdv kfv ffkjv kfvf kva  fvakf vvvvfhvbadflkvbafsvlakfhbj"/>
                </div>
            </div>
        </div>
    );
}
